import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Header from './components/Header.js'
import merch from './pages/merch.js';

const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path='/merch' component={merch}>
          </Route>
          </Routes>

    </BrowserRouter>

  )
}

export default App
